import React from "react";
import Card from "./Card";


const Tours = ({ tours }) => {


    return (<div>{
        tours.map((tour) => {
            { display(tour) }
            return (

                <Card {...tour}></Card>)

        }
        )
    }
    </div>
    )
}

export default Tours
